sap.ui.define(["./Series","./library","./thirdparty/d3","./thirdparty/moment-with-locales"],function(t){"use strict";return t.extend("openui5.financial.chart.LineChart",{metadata:{aggregations:{items:{type:"openui5.financial.chart.LineChartItem",multiple:true}}},renderer:{},_draw:function(){var e=this;t.prototype._draw.apply(e);var a=e.getParent();var r=a.getAggregation("_timeAxis");var i=r.getStart();var n=r.getEnd();var g=e.getItems().filter(t=>moment(t.getTime()).isBetween(i,n,"m","[]"));var l=r._scale;var s=a.getAggregation("_valueAxis")._scale;var d=d3.select("#"+e.getId());d.append("path").datum(g).attr("fill","none").attr("stroke","steelblue").attr("stroke-width",2).attr("d",d3.line().x(t=>l(moment(t.getTime()).toDate())).y(t=>s(t.getValue())))}})});